            var(--noto, "");
        --readable: "Public Sans", "Fira Sans", "Bahnschrift", "Aptos Narrow",
            "IBM Plex Sans Var", "IBM Plex Sans JP", "IBM Plex Sans KR",
            "IBM Plex Sans", var(--noto, "");
        /* --readable-full: "Public Sans", "Fira Sans", FiraGO, "FF Meta", Recursive, "Atkinson Hyperlegible", "Aptos",
            "Source Sans Pro", "Nunito Sans", "Nunito", "Raleway", "Road UA",
            "DIN Next", "Bahnschrift", "Aptos Narrow",
            "alte din 1451 mittelschrift", "Keiner", "Dinish", "Dinish Expanded",
            "Altinn-DIN", "D-DIN", "D-DIN Expanded", "DIN", "IBM Plex Sans Var", "IBM Plex Sans JP",
            "IBM Plex Sans KR", "IBM Plex Sans", "Aptos Display", var(--noto, ""),
            "Trebuchet MS", "Roadgeek 2014", "Roadgeek 2005"; */
    }
}

@-moz-document domain("youtube.com") {
    /* Class ytp-caption-segment  */
    .ytp-caption-segment {
        font-family: var(--readable, ""), var(--font, ""), "YouTube Noto", Roboto,
            "Arial Unicode Ms", Arial, Helvetica, Verdana, "PT Sans Caption",
            sans-serif !important;
        color: #fff000 !important;
        background: none !important;

        /* #000000 shadow with x and y offsets of 0 and blur radius 5px applied 4 times */
        /* text-shadow: #000000 0 0 5px, #000000 0 0 5px, #000000 0 0 5px,
            #000000 0 0 5px !important; */

        /* line-height: calc(2px 2ex 2px); */
        /* computed: 2px (2 * 20px) 2px = 44px */

        /* font-size: calc(14px (26 - 14) * ((100vw - 300px) / (1600 - 300))); */
        /* font-size: calc([minimum size] ([maximum size] - [minimum size]) * ((100vw - [minimum viewport width]) / ([maximum viewport width] - [minimum viewport width]))); */
        /* https://madebymike.com.au/writing/fluid-type-calc-examples/ */
    }

    .caption-window {
        padding: 0.45% !important;
        border-radius: 5px !important;
        background-color: rgba(8, 8, 8, 0.75) !important;
    }

    li.sbsb_c.gsfs div,
    .badge-shape-wiz,
    .badge.ytd-badge-supported-renderer,
    #owner-name.ytd-miniplayer,
    #modern-owner-name.ytd-miniplayer,
    .miniplayer-title.ytd-miniplayer,
